	return (
		<div>
			<NavBar SearchSpeeches={searchSpeeches} />
			<div id="cards">
				<Grid container spacing={2}
					direction="row"
					justify="flex-start"
					alignItems="baseline">
					<Grid item xs={"auto"}>
						<Card className={classes.card}>
							<CardActions>
								<ButtonBase>
									<CardContent>
										<b>Settings</b><br />
										<FormControl component="fieldset">
											<FormLabel component="legend">Assign responsibility</FormLabel>
											<FormGroup>
												<FormControlLabel
													control={<Switch checked={state.gilad} onChange={handleChange('gilad')} value="gilad" />}
													label="Gilad Gray"
												/>
												<FormControlLabel
													control={<Switch checked={state.jason} onChange={handleChange('jason')} value="jason" />}
													label="Jason Killian"
												/>
												<FormControlLabel
													control={
														<Switch checked={state.antoine} onChange={handleChange('antoine')} value="antoine" />
													}
													label="Antoine Llorca"
												/>
											</FormGroup>
											<FormHelperText>Be careful</FormHelperText>
										</FormControl>
									</CardContent>
								</ButtonBase>
							</CardActions>
						</Card>
					</Grid>
				</Grid>
			</div>
		</div>
	);
}
